        <figcaption>Franquiada em São Paulo</figcaption>
    </figure>
    <p>
        A Bom Gosto começou em um imóvel de 20 m² em Duque de Caxias, região metropolitana do Rio de Janeiro, e hoje conta com mais de 315 lojas espalhadas pelo Brasil. Atualmente é considerada a maior franquia especializada em bolos artesanais do país. Mas foi
        abraçando as oportunidades e com muito trabalho que a idealizadora da marca, Maria da Silva, conseguiu levar seu empreendimento a esse patamar.
    </p>
    <p>
        Era o ano de 1997, e Maria estava, então, tendo a oportunidade de abrir seu negócio, ainda que muito tímido. Mas até chegar esse dia, as coisas foram bem difíceis para ela. De família pobre, Maria trabalhou como boia-fria – foi cortadora de cana – e depois
        como empregada doméstica. Mas foi como funcionária de uma empresa que veio a oportunida");
            WriteLiteral(@"de. A mulher do patrão fazia bolos para fora e, quando teve um problema de saúde, pediu para Maria ajudá-la, até que acabou por parar com a
