    </p>
    <p>E foi fazendo bolo, que levava aos clientes a pé, e aprimorando a receita, com a ajuda de sua mãe, que Maria conseguiu abrir o pequeno espaço em Salto. Ali, logo colocaram à venda, também, as balas de leite Ninho cuja receita foi aprendida
        em um programa de TV. Juntou o sucesso das balas com o dos bolos, que foram ficando cada vez mais aprimorados, e o negócio foi crescendo. Quatro anos depois, mudou o empreendimento para um espaço de 80 m², quatro vezes maior do
        que o primeiro. Tendo como sócios irmãos e ex-funcionários, foi abrindo outras lojas, em cidades próximas, como Nova Iguaçu, São João de Merití, Itu e Indaiatuba. Dez anos e muito trabalho depois, a Bom Gosto Doces virou franquia,
        em 2007, termo que Maria nem sabia o que era quando um cliente a questionou sobr");
